import React, { useState } from "react";
import InputField from "./InputField";
import SelectField from "./SelectField";

const defaultForm = {
  email: "",
  fullName: "",
  age: "",
  education: "",
  institute: "",
  program: "",
  experience: "",
  canadaInstitute: "",
  canadaProgram: "",
  coutry: "",
  goals: "",
  scoresListening: "",
  scoresReading: "",
  scoresSpeaking: "",
  scoresWriting: "",
  isPaidTutionFees: null,
  paidTutionAmount: "",
  isGic: null,
  paidGicAmout: "",
};

export default function Form() {
  const [form, setForm] = useState(defaultForm);

  return (
    <div>
      <form>
        <InputField name="email" type="email" value={form.email} />
        <InputField name="fullName" type="text" value={form.fullName} />
        <InputField name="age" type="number" value={form.age} />
       <SelectField name="education" options={[{
        label: "Grade 12",
        value:"Grade 12"
       },
       {
        label: "Diploma",
        value:"Diploma"
       },
       {
        label: "Bachelors Degree",
        value:"Bachelors Degree"
       },
       {
        label: "Masters Degree",
        value:"Masters Degree"
       },
       {
        label: "Grade 12",
        value:"Grade 12"
       },
       ]} />
      </form>
    </div>
  );
}
